import React from 'react';
import { Link } from 'react-router-dom';
import Logo from './images/booksandbrewskies/logo.png';
import {Link as NavLink} from 'react-scroll';

const Header = () => {

  return (
    <nav className="site-header sticky-top py-1" style={{backgroundColor: "#130f0a", opacity: "0.9"}}>
  <div className="container d-flex flex-md-row justify-content-between" style={{maxWidth: "960px"}}>
    <Link to="/" className="py-2" aria-label="Product"><img src={Logo} alt="logo" height="50px" width="50px" /></Link>
    <a class="py-2 d-md-inline-block mt-2" href="#">Store</a>
    <a class="py-2 d-md-inline-block mt-2" href="#">Podcast</a>
    <a class="py-2 d-md-inline-block mt-2" href="#">Events</a>
    <a class="py-2 d-md-inline-block mt-2" href="#">Team</a>
    <a class="py-2 d-md-inline-block mt-2"  href="#">Contact</a>
    <Link activeClass="active"
      to="Store-Content"
      spy={true}
      smooth={true}
      hashSpy={true}
      offset={50}
      duration={500}
      delay={1000}
      isDynamic={true}
      onSetActive={(props)=>console.log(props)}
      onSetInactive={(props)=>console.log(props)}
      ignoreCancelEvents={false}
>
Store
</Link>

  </div>
</nav>
  )
}

export default Header;
